CREATE TABLE Languages (
     id CHAR(2),
  name_en VARCHAR(50),
  PRIMARY KEY (id)
);
CREATE TABLE Nations (
     id CHAR(2),
  name_en VARCHAR(50),
  area BIGINT,
  population BIGINT,
  curr VARCHAR(50),
  isocode VARCHAR(50),
  PRIMARY KEY (id)
);
CREATE TABLE Cities (
     nation_id CHAR(2),
  id BIGINT,
  name VARCHAR(50),
  zipCode VARCHAR(50),
  inhabitants BIGINT,
  PRIMARY KEY (nation_id, id)
);
CREATE TABLE Organisations (
     id BIGINT,
  email VARCHAR(60),
  phone VARCHAR(50),
  gsm VARCHAR(50),
  fax VARCHAR(50),
  website VARCHAR(200),
  nation_id CHAR(2),
  city_nation_id CHAR(2),
  city_id BIGINT,
  zip VARCHAR(50),
  street VARCHAR(50),
  house BIGINT,
  box VARCHAR(50),
  name VARCHAR(50),
  PRIMARY KEY (id)
);
CREATE TABLE Persons (
     id BIGINT,
  name VARCHAR(50),
  firstName VARCHAR(50),
  sex CHAR(1),
  birthDate CHAR(8),
  PRIMARY KEY (id)
);
CREATE TABLE Partners (
     id BIGINT,
  name VARCHAR(50),
  firstName VARCHAR(50),
  email VARCHAR(60),
  phone VARCHAR(50),
  gsm VARCHAR(50),
  fax VARCHAR(50),
  website VARCHAR(200),
  nation_id CHAR(2),
  city_nation_id CHAR(2),
  city_id BIGINT,
  zip VARCHAR(50),
  street VARCHAR(50),
  house BIGINT,
  box VARCHAR(50),
  type_id VARCHAR(50),
  title VARCHAR(50),
  logo VARCHAR(50),
  lang_id CHAR(2),
  PRIMARY KEY (id)
);
CREATE TABLE PartnerTypes (
     id VARCHAR(50),
  name_en VARCHAR(50),
  PRIMARY KEY (id)
);
